import React from 'react';
import "./Pack.css"
import packimage from "./TOPPS_1975.jpg";

const pack = props => {
    let cardClass = 'packstylefetching';
    if (!props.fetchingpack) {
        cardClass = 'packstyle'
    }
    return (
        <div className = "full_pack">
            <div className={cardClass}><img src={packimage} onClick={props.handlePackClick} alt="pack_image" />
            </div>
            <p>click pack to open</p>
        </div>
    );
};
export default pack
